INSERT INTO `post_wish_canopy_tbls` (`id`, `popup_name`, `popup_details`, `piller_post_id`, `video_link_data`, `image_link_data`, `canopy_type_text_description`, `admin_action`, `created_at`, `updated_at`) VALUES
(2, 'read more ...', '<p><img alt=\"\" src=\"/ckfinder/userfiles/files/p3.png\" style=\"float:left; height:203px; width:360px\" />In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before final copy is available.</p>\r\n', 1, NULL, NULL, '<p>Our unique patented design allows the canopy fabric material (Harbor Time) to run smoothly between two outside tracks. Structural rods or &ldquo;Wings&rdquo; hold the fabric in place. Each wing has independently tensioned wheels on each end that move in and out between the tracks to ensure the canopy retracts and extends smoothly and easily. All tracks and wing components are black anodized aluminum which do not rust over time&nbsp;<a href=\"http://www.youtube.com/watch?v=cQ50qnubIfk\" target=\"_blank\">Retractable Canopy Installation Video</a></p>', 'yes', NULL, '2021-09-25 12:24:13'),
(3, 'read more ...', '<p><img alt=\"\" src=\"/ckfinder/userfiles/files/p3.png\" style=\"float:left; height:203px; width:360px\" />In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before final copy is available.</p>\r\n', 2, 'public/postwish/canopy/0gRcEDXkhZwCJh4XvI0aRuAh7JiLp5R6wGaSyDYX.mp4', NULL, '<p>Our unique patented design allows the canopy fabric material (Harbor Time) to run smoothly between two outside tracks. Structural rods or &ldquo;Wings&rdquo; hold the fabric in place. Each wing has independently tensioned wheels on each end that move in and out between the tracks to ensure the canopy retracts and extends smoothly and easily. All tracks and wing components are black anodized aluminum which do not rust over time.</p>\r\n\r\n<p><a href=\"http://www.youtube.com/watch?v=cQ50qnubIfk\" target=\"_blank\">Retractable Canopy Installation Video</a></p>', 'yes', NULL, '2021-09-25 12:26:19'),
